import React from "react";
import Todo from "./Todo";

const TodoList = (props) => {
  return (
    <div>
      <ul>
        {props.todoList.map((todo, i) => (
          <Todo todo={todo} key={i} />
        ))}
      </ul>
    </div>
  );
};

export default TodoList;
